import styled from "styled-components";

const AuthStyle = {
    ContainerAuth: styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
    border: solid 1px black;
    border-radius: 5px;
    max-width: 400px;
    margin: auto;
    `,
    FormAuth: styled.form`
    display: flex;
    flex-wrap: nowrap;
    flex-direction: column;
    > ${inpu} {
        padding-bottom: 20px;
    }
    `
}

export default AuthStyle
